<!DOCTYPE html>
<html lang="pt-BR">
<head>
<meta charset="UTF-8">
<title>Pong</title>
<link rel="stylesheet" href="style.css">
</head>
<body>

<!-- Menus -->
  <h1>Pong</h1>
  <div id="timer"></div>
  <canvas id="gameCanvas" width="800" height="400"></canvas>
  <div id="message">Pressione ENTER para começar</div>

  <!-- MENUS -->
  <div id="menu" class="menu" style="display:block;">
    <div class="menu-option" data-action="cpu">1 Jogador</div>
    <div class="menu-option" data-action="2p">2 Jogadores</div>
    <div class="menu-option" data-action="ranking">Ranking</div>
    <div class="menu-option" data-action="help">Ajuda</div>
  </div>

  <div id="difficultyMenu" class="menu">
    <div class="menu-option" data-diff="veryeasy">Muito Fácil</div>
    <div class="menu-option" data-diff="easy">Fácil</div>
    <div class="menu-option" data-diff="normal">Normal</div>
    <div class="menu-option" data-diff="medium">Médio</div>
    <div class="menu-option" data-diff="hard">Difícil</div>
    <div class="menu-option" data-diff="impossible">Impossível</div>
  </div>

  <div id="nameMenu" class="menu">
    <h3>Digite os nomes:</h3>
    <input id="player1Name" placeholder="Player 1"><br>
    <input id="player2Name" placeholder="Player 2"><br>
    <button id="startGameBtn">Iniciar</button>
  </div>

  <div id="helpMenu" class="menu">
    <h3>Ajuda</h3>
    <p>Use W/S ou setas para mover a raquete.</p>
    <div class="menu-option" data-action="back">Voltar</div>
  </div>

  <div id="rankingMenu" class="menu">
    <h2>Ranking</h2>
    <ul id="rankingList"></ul>
    <div class="menu-option" data-action="back">Voltar</div>
  </div>

  <div id="endMenu" class="menu">
    <h2 id="winnerText"></h2>
    <div class="menu-option">Revanche</div>
    <div class="menu-option">Menu Principal</div>
  </div>

  <!-- CONTROLES TOUCH -->
  <div class="touch-controls">
    <div class="side">
      <div class="touch-btn" id="p1-up">▲</div>
      <div class="touch-btn" id="p1-down">▼</div>
    </div>
    <div class="side">
      <div class="touch-btn" id="p2-up">▲</div>
      <div class="touch-btn" id="p2-down">▼</div>
    </div>
  </div>
